DROP TABLE IF EXISTS `activity`;
CREATE TABLE `activity` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '活动标题',
  `title_pic` varchar(500) NOT NULL DEFAULT '' COMMENT '活动标题图片路径',
  `intro` text DEFAULT NULL COMMENT '活动简介',
  `main_pic` varchar(500) DEFAULT '' COMMENT '活动主图路径',
  `school_id` bigint(20) DEFAULT NULL COMMENT '学校id',
  `grade` varchar(20) DEFAULT NULL COMMENT '年级id',
  `start_time` datetime DEFAULT NULL COMMENT '活动开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '活动结束时间',
  `finished` int(11) DEFAULT NULL COMMENT '是否结束 0.进行中 1.已完成',
  `type` int(11) NOT NULL COMMENT '类型 1.英语活动 2.语文活动',
  `published` int(11) NOT NULL COMMENT '是否发布 1.已发布 2.未发布',
  `create_user` bigint(20) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` bigint(20) DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

